import numpy as npimport matplotlib.pyplot as pltimport pandas as pdreadData = pd.read_csv('complicated_2v2.csv', header=None)#2D Visualizaitondef data_visualization_2dr(w_data, title, i=0, visualize=True):    if visualize:        plt.axis([0, len(w_data[0]), 0, len(w_data)])        # w_data[w_data >= 0] = 0        # w_data[w_data >= 100] = 0        x, y = w_data.nonzero()        # x = range(0, 65)        # y = range(0, 44)        c = w_data[x, y]        plt.scatter(y[:], x[:], c=c[:], cmap='jet')        plt.title(title)        plt.colorbar()        # plt.savefig('com/fig' + str(i) + '.png')        # plt.clim(-5, 0)        plt.show()        plt.close()def function1(model_num, x_start, x_end, y_start, y_end, col):    temp = pd.to_numeric(np.array(readData[model_num])[:]).reshape((44, 65))    # temp[temp < 0] = 0 # commented out these two lines, might be necessary sometimes later    # temp[temp > 50] = 50    spec_arr = temp[y_start:y_end, x_start:x_end]    ##Ramyaa    for j in range (y_start, y_end):        for i in range(x_start, x_end):            print(j, i, spec_arr[18, 9])            if spec_arr[j, i] > 0:                spec_arr[j, i] = col    ## End Ramyaa    return spec_arrdef function2(arr):    data_visualization_2dr(arr, "numpy array plot")##Ramyaanumpy_arr_3 = function1(3, 40, 64, 25, 43, 30)##End Ramyaa       function2(numpy_arr_3)